import { Route, Switch } from 'react-router-dom';
import Auth from './components/Auth';
import Home from './components/Home';
import AdminDashboard from './components/AdminDashboard';
import ApplyTutor from './components/ApplyTutor';
import TutorDashboard from './components/TutorDashboard';
import Navbar from './components/Navbar';
import './styles.css';

export default function App(props) {
    return (
        <main>
            <Navbar />
            <Switch>
                <Route path="/" exact component={Auth} />
                <Route path="/googlefailure" exact render={(props) => {
                    return <Auth error={"It seems that you have signed up with a password. Please login using your email and password."}/>
                }}/>
                <Route path="/home" exact component={Home} />
                <Route path="/apply" exact component={ApplyTutor} />
                <Route path="/" exact component={Auth} />
                <Route path="/home" exact render={(props) => {
                    return <div className="body">
                        <Home />
                    </div>
                }}/>
                <Route path="/admin" exact render={(props) => {
                    return <div className="body">
                        <AdminDashboard />
                    </div>
                }}/>
                <Route path="/apply" exact render={(props) => {
                    return <div className="body">
                        <ApplyTutor />
                    </div>
                }}/>
                <Route path="/tutorDashboard" exact render={(props) => {
                    return <div className="body">
                        <TutorDashboard />
                    </div>
                }}/>
            </Switch>
        </main>
    )
}
